import axios from "axios";

export const addFormInputs = async (id, inputName, inputVal) => {
  try {
    const res = axios.post("http://localhost:5000/forms/addFormInput", {
      inputName: inputName,
      inputVal: inputVal,
      id: id,
    });
    return res;
  } catch (error) {
    console.log(error);
  }
};
